import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <ul className="nav-ul">
        <li><Link></Link></li>
        <li>Signup</li>
        <li>Login</li>
      </ul>
    </>
  );
};

export default Navbar;
